/** @jsx jsx */
import { css, jsx } from '@emotion/core';

const Card = ({ children }) => {
  return (
    <div
      css={css`
        width: 100%;
        border-radius: 5px;
        background: var(--black-light);
      `}>
      {children}
    </div>
  );
};

export default Card;
